    if(props.numberOfEnemiesInRoom === 1){
        return(
            <div>
                
                <button className="healMove">Heal</button>
            </div>
        )
    }
    if(props.numberOfEnemiesInRoom === 2){
        return(
            <div>
                
                <button className="healMove">Heal</button>
            </div>
        )
    }
    if(props.numberOfEnemiesInRoom === 3){
        return(
            <div>
                
                <button className="healMove">Heal</button>
            </div>
        )
    }
}

